import { ExportJSONPlugin } from "./ExportJSONPlugin.js";
export async function loadExportJSONPlugin(engine, refresh = true) {
    engine.checkVersion("3.8.1");
    await engine.addPlugin(new ExportJSONPlugin(engine), refresh);
}
